INSERT INTO `content` VALUES (1,'Dick Johnson Is Dead','2021-09-25 00:00:00','PG-13','As her father nears the end of his life, filmmaker Kirsten Johnson stages his death in inventive and comical ways to help them both face the inevitable.'),(2,'Blood & Water','2021-09-24 00:00:00','TV-MA','After crossing paths at a party, a Cape Town teen sets out to prove whether a private-school swimming star is her sister who was abducted at birth.'),(3,'Ganglands','2021-09-24 00:00:00','TV-MA','To protect his family from a powerful drug lord, skilled thief Mehdi and his expert team of robbers are pulled into a violent and deadly turf war.'),(4,'Jailbirds New Orleans','2021-09-24 00:00:00','TV-MA','Feuds, flirtations and toilet talk go down among the incarcerated women at the Orleans Justice Center in New Orleans on this gritty reality series.'),(5,'Kota Factory','2021-09-24 00:00:00','TV-MA','In a city of coaching centers known to train India’s finest collegiate minds, an earnest but unexceptional student and his friends navigate campus life.'),(6,'Midnight Mass','2021-09-24 00:00:00','TV-MA','The arrival of a charismatic young priest brings glorious miracles, ominous mysteries and renewed religious fervor to a dying town desperate to believe.'),(7,'My Little Pony: A New Generation','2021-09-24 00:00:00','PG','Equestrias divided. But a bright-eyed hero believes Earth Ponies, Pegasi and Unicorns should be pals — and, hoof to heart, she’s determined to prove it.'),(8,'Sankofa','2021-09-24 00:00:00','TV-MA','On a photo shoot in Ghana, an American model slips back in time, becomes enslaved on a plantation and bears witness to the agony of her ancestral past.'),(9,'The Great British Baking Show','2021-09-24 00:00:00','TV-14','A talented batch of amateur bakers face off in a 10-week competition, whipping up their best dishes in the hopes of being named the U.K.s best.'),(10,'The Starling','2021-09-24 00:00:00','PG-13','A woman adjusting to life after a loss contends with a feisty bird