nd as they struggle to convince others of the deadly threat.'),(30,'Paranoia','2021-09-19 00:00:00','PG-13','Blackmailed by his companys CEO, a low-level employee finds himself forced to spy on the bosss rival and former mentor.'),(31,'Ankahi Kahaniya','2021-09-17 00:00:00','TV-14','As big city life buzzes around them, lonely souls discover surprising sources of connection and companionship in three tales of love, loss and longing.'),(32,'Chicago Party Aunt','2021-09-17 00:00:00','TV-MA','Chicago Party Aunt Diane is an idolized troublemaker with a talent for avoiding adulthood — and a soft spot for her soul-searching nephew.'),(33,'Sex Education','2021-09-17 00:00:00','TV-MA','Insecure Otis has all the answers when it comes to sex advice, thanks to his therapist mom. So rebel Maeve proposes a school sex-therapy clinic.'),(34,'Squid Game','2021-09-17 00:00:00','TV-MA','Hundreds of cash-strapped players accept a strange invitation to compete in childrens games. Inside, a tempting prize awaits — with deadly high stakes.'),(35,'Tayo and Little Wizards','2021-09-17 00:00:00','TV-Y7','Tayo speeds into an adventure when his friends get kidnapped by evil magicians invading their city in search of a magical gemstone.'),(36,'The Father Who Moves Mountains','2021-09-17 00:00:00','TV-MA','When his son goes missing during a snowy hike in the mountains, a retired intelligence officer will stop at nothing — and risk everything — to find him.'),(37,'The Stronghold','2021-09-17 00:00:00','TV-MA','Tired of the small-time grind, three Marseille cops get a chance to bust a major drug network. But lines blur when a key informant makes a big ask.'),(38,'Angry Birds','2021-09-16 00:00:00','TV-Y7','Birds Red, Chuck and their feathered friends have lots of adventures while guarding eggs in their nest that pesky pigs keep trying to steal.'),(39,'Birth of the Dragon','2021-09-16 00:00:00','PG-13','A young Bruce Lee angers kung fu traditionalists by teaching outsiders, leading to a showdown wi