ng-missing pal, Sasuke, to save the planet.'),(59,'Naruto Shippûden the Movie: The Will of Fire','2021-09-15 00:00:00','TV-PG','When four out of five ninja villages are destroyed, the leader of the one spared tries to find the true culprit and protect his land.'),(60,'Naruto Shippuden: The Movie','2021-09-15 00:00:00','TV-PG','The adventures of adolescent ninja Naruto Uzumaki continue as hes tasked with protecting a priestess from a demon – but to do so, he must die.'),(61,'Naruto Shippuden: The Movie: The Lost Tower','2021-09-15 00:00:00','TV-14','When Naruto is sent to recover a missing nin, the rogue manages to send him 20 years into the past, where he unites with his father to battle evil.'),(62,'Naruto the Movie 2: Legend of the Stone of Gelel','2021-09-15 00:00:00','TV-PG','While on a mission to return a missing pet, Naruto and two fellow ninjas are ambushed by brutal knights led by the enigmatic Temujin.'),(63,'Naruto the Movie 3: Guardians of the Crescent Moon Kingdom','2021-09-15 00:00:00','TV-PG','Exuberant ninja Naruto teams up with his pals Sakura and Kakashi to escort Prince Michiru and his son, Hikaru, to the Crescent Moon kingdom.'),(64,'Naruto the Movie: Ninja Clash in the Land of Snow','2021-09-15 00:00:00','TV-PG','Naruto, Sasuke and Sakura learn theyll be protecting an actress from being hurt while making her next film, but it turns out shes a princess.'),(65,'Nightbooks','2021-09-15 00:00:00','TV-PG','Scary story fan Alex must tell a spine-tingling tale every night — or stay trapped with his new friend in a wicked witchs magical apartment forever.'),(66,'Numberblocks','2021-09-15 00:00:00','TV-Y','In a place called Numberland, math adds up to tons of fun when a group of cheerful blocks work, play and sing together.'),(67,'Raja Rasoi Aur Anya Kahaniyan','2021-09-15 00:00:00','TV-G','Explore the history and flavors of regional Indian cuisine, from traditional Kashmiri feasts to the vegetarian dishes of Gujarat.'),(68,'Saved by the Bell','2021-09-15 00:00:00','TV-PG','From middle school to college, best friends Zack, Kelly, Slater, Jessie, Screech and Lisa take on the highs and lows of life together in this hit series.'),(69,'Schumacher','2021-09-15 00:00:00','TV-14','Through exclusive interviews and archival footage, this documentary traces an intimate portrait of seven-time Formula 1 champion Michael Schumacher.'),(70,'Stories by Rabindranath Tagore','2021-09-15 00:00:00','TV-PG','The writings of Nobel Prize winner Rabindranath Tagore come to life in this collection of tales set in early-20th-century Bengal.'),(71,'Too Hot To Handle: Latino','2021-09-15 00:00:00','TV-MA','On this reality show, singles from Latin America and Spain are challenged to give up sex. But here, abstinence comes with a silver lining: US$100,000.'),(72,'A StoryBots Space Adventure','2021-09-14 00:00:00','TV-Y','Join the StoryBots and the space travelers of the historic Inspiration4 mission as they search for answers to kids questions about space.'),(73,'Jack Whitehall: Travels with My Father','2021-09-14 00:00:00','TV-MA','Jovial comic Jack Whitehall invites his stuffy father, Michael, to travel with him through Southeast Asia in an attempt to strengthen their bond.'),(74,'King of Boys','2021-09-14 00:00:00','TV-MA','When a powerful businesswoman’s political ambitions are threatened by her underworld connections, the ensuing power struggle could cost her everything.'),(75,'The Worlds Most Amazing Vacation Rentals','2021-09-14 00:00:00','TV-PG','With an eye for every budget, three travelers visit vacation rentals around the globe and share their expert tips and tricks in this reality series.'),(76,'You vs. Wild: Out Cold','2021-09-14 00:00:00','TV-G','After a plane crash leaves Bear with amnesia, he must make choices to save the missing pilot and survive in this high-stakes interactive adventure.'),(77,'Yowamushi Pedal','2021-09-14 00:00:00','TV-14','A timid, anime-loving teen gets drawn into a school cycling club, where his new friend